// Layout
import LayoutEspecial from '../Layouts/LayOutMenu';
import layoutMenu from '../Layouts/LayOutMenu';

// Pages

import MenuEspecialidades from '../Pages/AdminRestaurante/Especialidades';
import Login from '../Pages/Login';

const routes = [{

    path: '/AdminRestaurante',
    component: layoutMenu,
    exact: true,
    routes: [
        {
            path: "/AdminRestaurante/Especialidades",
            component: MenuEspecialidades,
            exact: true

        }
    ]

},
{
    path: '/',
    component: Login,
    exact: false,
    routes: [
        {

            path: "/",
            component: Login,
            exact: true

        }
    ]

}
];


export default routes;
